(() => {
    if (!window.app) {
        window.app = {};
    }

    if (!('modules' in window.app)) {
        window.app.modules = {};
    }

    if ('gallery' in app.modules) {
        return;
    }

    /**
     * Creates a new Gallery class.
     * @class
     */
    const Gallery = function() {
        const self = this;

        /**
         * Get options for module
         */
        self.getOptions = () => {
            self.container = document.querySelector('.gallery');
            self.mount = document.querySelector('.gallery__mount');
            self.data = JSON.parse(self.container.getAttribute('data-gallery')) || [];
            self.template = document.querySelector('#templateDefault').innerHTML;
            self.modal = document.querySelector('.galleryModal');
            self.modalTitle = document.querySelector('.galleryModal__title');
            self.modalDescription = document.querySelector('.galleryModal__description p');
            self.modalImg = document.querySelector('.galleryModal__preview img');
            self.modalCloseBtn = document.querySelector('.galleryModal__close');
            self.modalArrowPrev = document.querySelector('.galleryModal__arrow_prev');
            self.modalArrowNext = document.querySelector('.galleryModal__arrow_next');
        };

        /**
         * Add events listeners
         */
        self.setupListener = () => {
            self.container.addEventListener('click', self.handleClick);
            self.modalCloseBtn.addEventListener('click', self.closeModal);
            self.modalArrowPrev.addEventListener('click', self.nextModal);
            self.modalArrowNext.addEventListener('click', self.nextModal);
        };

        /**
         * Handle click event
         * @param {Object} event
         */
        self.handleClick = function(event) {
            const target = event.target;
            const link = target.closest('.galleryItem__link');

            event.preventDefault();

            if (!link) {
                return;
            }

            const id = link.id;

            self.data = self.data.map(galleryItem => {
                if (galleryItem.id === id) {

                    galleryItem.isOpen = true;

                }

                return galleryItem;
            });

            self.setupModal();
            self.openModal();
        };

        /**
         * Open modal window
         */
        self.openModal = () => {
            self.modal.classList.add('galleryModal_state_open');
            self.modal.classList.add('galleryModal_state_loading');
        };

        /**
         * Close modal window
         */
        self.closeModal = () => {
            const id = self.modal.getAttribute('data-id');

            self.data = self.data.map(galleryItem => {
                if (galleryItem.id === id) {

                    galleryItem.isOpen = false;

                }

                return galleryItem;
            });

            self.modal.classList.remove('galleryModal_state_open');
            self.modal.classList.remove('galleryModal_state_prev');
            self.modal.classList.remove('galleryModal_state_next');

            self.modalImg.removeEventListener('load', self.loadModal);
        };

        /**
         * Setup modal content
         */
        self.setupModal = () => {
            const index = self.data.findIndex(galleryItem => galleryItem.isOpen);
            const data = self.data[index] || {};
            const prevItem = self.data[index - 1];
            const nextItem = self.data[index + 1];

            data.id = data.id ? data.id : '';
            data.title = data.title ? data.title : 'Заголовок изображения не найден';
            data.description = data.description ? data.description : 'Описание изображения не найдено.';
            data.source = data.source ? data.source : 'data:image/jpeg;base64,';

            self.modal.setAttribute('data-id', data.id);
            self.modalTitle.textContent = data.title;
            self.modalDescription.textContent = data.description;
            self.modalImg.src = data.source;

            if (prevItem && prevItem.id) {

                self.modalArrowPrev.setAttribute('data-id', prevItem.id);
                self.modal.classList.add('galleryModal_state_prev');

            } else {

                self.modalArrowPrev.setAttribute('data-id', '');
                self.modal.classList.remove('galleryModal_state_prev');

            }

            if (nextItem && nextItem.id) {

                self.modalArrowNext.setAttribute('data-id', nextItem.id);
                self.modal.classList.add('galleryModal_state_next');

            } else {

                self.modalArrowNext.setAttribute('data-id', '');
                self.modal.classList.remove('galleryModal_state_next');

            }

            self.modalImg.addEventListener('load', self.loadModal);
        };

        /**
         * Handle click on modal window arrow
         * @param {Object} event
         */
        self.nextModal = (event) => {
            const target = event.target;

            event.preventDefault();

            if (!target) {
                return;
            }

            const id = target.getAttribute('data-id');

            if (id) {

                self.data = self.data.map(galleryItem => {
                    galleryItem.isOpen = galleryItem.id === id ? true : false;


                    return galleryItem;
                });

                self.modalImg.src = '';

                self.setupModal();

            }
        };

        /**
         * Remove loading state after modal image has been loaded
         */
        self.loadModal = () => {
            self.modal.classList.remove('galleryModal_state_loading');
        };

        /**
         * Render gallery
         */
        self.render = () => {
            const list = document.createElement('ul');

            list.classList.add('gallery__list');

            self.data.forEach(galleryItem => {
                const listItem = document.createElement('li');

                listItem.classList.add('gallery__item');
                listItem.innerHTML = self.template;

                const link = listItem.querySelector('.galleryItem__link');
                const img = listItem.querySelector('.galleryItem__img');
                const title = listItem.querySelector('.galleryItem__title');

                link.href = galleryItem.source;
                link.title = galleryItem.title;
                link.id = galleryItem.id;

                img.src = galleryItem.preview;
                img.alt = galleryItem.title;

                title.textContent = galleryItem.title;

                list.appendChild(listItem);
            });

            self.mount.innerHTML = '';

            self.mount.appendChild(list);
        };

        /**
         * Init module
         */
        self.init = () => {
            self.getOptions();
            self.render();
            self.setupListener();
        };
    };

    window.app.modules.gallery = new Gallery();
})();
